import axios from "axios";

const getData = async (token, setToken, employees, setEmployees) => {
  try {
        const resp = await axios
      .post("http://cms.avertra.com/auth/local", {
        identifier: "Cms@avertra.com",
        password: "Avertra@2021",
      })
   
  } catch (err) {
    // Handle Error Here
    console.error(err);
  }
};

export { getData };
